    job: '프론트엔드 개발자',
    },
    {
    id: 3,
    name: '박기획',
    intro: '데이터 기반 의사결정을 선호하는 PM',
    strengths: 'SQL, Tableau 사용에 능숙합니다. \nA/B 테스트 설계 및 분석 경험이 많습니다.',
